import React from 'react';
import '../App.css';
import { useNavigate, Navigate, Link } from 'react-router-dom';
import Grid from '@mui/material/Grid';
// import axios from 'axios';
import {
  Button,
  CssBaseline,
  TextField,
  Typography,
  Container,
  List,
  ListItem,
  Divider,
} from '@mui/material';
import { styled } from '@mui/system';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const defaultTheme = createTheme();
const Box = styled('div')({
  display: 'flex',
  height: '100%',
  border: '1px solid lightGrey',
  borderRadius: '15px',
  padding: '10px'
})
const Item = styled('div')({
  display: 'flex',
  border: '1px solid lightGrey',
  borderRadius: '15px',
  padding: '10px',
})

function Experiences({ token, setTokenFunction }) {
  const navigate = useNavigate();

  // this should save the experience selected.
  const chooseExperience = async (e) => {
    e.preventDefault();
    try {
      navigate('/projects')
    } catch (err) {
      alert(err.response.data.error);
    }
  };

  return (
      <Container component="main" maxWidth="md" sx={{ padding: 0 }}>
        <h6>
          Step <u>1</u> of <u>3</u>
        </h6>
        <h2>
          Choose set of Experience
        </h2>
        <Grid sx={{ flexGrow: 1, height: "700px" }} container spacing={2}>
          <Grid item xs={4}>
            <Box>
              <Grid sx={{ flexGrow: 1, height: "100%" }} container spacing={2}>
                <Grid item xs={12} sx={{ height: "20%" }}>
                  <Item sx={{ height: "90%"}}>
                    Premium
                  </Item>
                </Grid>
                <Grid item xs={12} sx={{ height: "80%" }}>
                  <Grid sx={{ flexGrow: 1, height: "100%" }} container row={2}>
                    <Grid item xs={12}>
                      <Item sx={{ height: "100%"}}>
                        <List sx={{ width: "100%" }}>
                          <ListItem alignItems="flex-start"
                            primary="Company"
                            secondary="Ernst & Young"
                          >
                          </ListItem>
                        </List>
                      </Item>
                    </Grid>
                  </Grid>
                </Grid>
              </Grid>
            </Box>
          </Grid>
          <Grid item xs={4}>
            <Box>
              Plus
            </Box>
          </Grid>
          <Grid item xs={4}>
            <Box>
              Base
            </Box>
          </Grid>
        </Grid>
      </Container>
  )
}

export default Experiences;
